/// <summary>
/// Disable fields based on fieldId
/// </summary>
public void allowEditListSelectionField(fieldId _listSelectionField)
{
    switch (_listSelectionField)
    {
        case fieldNum(InventDim,InventLocationId) :
            inventDimSetupGrid_ds.object(fieldNum(InventDimSetupGrid, ShowGridTransferOrder)).allowEdit(false);
            break;
        case fieldNum(InventDim,InventSiteId) :
            inventDimSetupGrid_ds.object(fieldNum(InventDimSetupGrid, ShowGridTransferOrder)).allowEdit(false);
            break;
        default :
            break;
    }
}

public void close()
{
    if (!element.args()
        || element.args().parmEnumType() != enumNum(CostFormContext)
        || element.args().parmEnum() != CostFormContext::Costing)
    {
        if (!inventParameters.FallbackInventLocationId)
        {
            warning("@SCM:InventParametersDefaultWarehouseMissing");
            info("@SYS138747");
        }
    }

    super();
}

