void fillView()
{
    InventDimMetaDataCache::fillParameterFormView(dimensionList);
    element.setupAllowEdit(true);
    //Workaround for making parameters editable and mapped to first item on listview when the tab is loaded first time
    dimensionList.selectionChanged(0, null);
}

public void init()
{
    this.numberSeqPreInit();

    super();

    InventParameters::find();
    CostInventoryAccountingKPIGoals::find();
    BOMParameters::find();
    WMSParameters::find();

    if (#PdsMRCEnabled)
    {
        PdsMRCParameters::find();
    }

    if (#PdsCommodityEnabled)
    {
        PdsParameters::find();
    }

    this.numberSeqPostInit();

    InventDimSetupGrid::loadSetup();

    this.fillView();
    // <GEEU>
    inventParameters_ds.object(fieldNum(InventParameters, InventAdjustCorrection)).visible(LedgerParameters::isStornoEnabledEE());
    // </GEEU>

    if (element.args()
        && element.args().parmEnumType() == enumNum(CostFormContext))
    {
        CostFormContext formContextEnum = element.args().parmEnum();
        switch (formContextEnum)
        {
            case CostFormContext::Costing:
                this.callerBasedFormInit(formContextEnum);
                break;
        }
    }

    inventParameters_ds.object(fieldNum(InventParameters, AllowEmptyAttributeValues)).visible(true);
    inventParameters_ds.object(fieldNum(InventParameters, IntercompanyOnhandSkipClosedQty)).visible(InventIntercompanyOnhandSkipClosedQtyFeature::isEnabled());

    InventValueReportStorage.visible(InventValueReportStorageBundleFeature::isEnabled());
}

void listSelection()
{
    int idx;
    FormListItem    item;

    if (inventDimSetupGrid.RecId)
    {
        inventDimSetupGrid.write();
    }

    idx = max(0, dimensionList.getNextItem(FormListNext::Selected));

    if (idx <0)
    {
        element.setupAllowEdit(false);
        tmpFieldId = 0;
        inventDimSetupGrid_ds.executeQuery();
        inventDimSetupGrid_ds.refresh();
        return;
    }

    element.setupAllowEdit(true);

    tmpFieldId   = dimensionList.getItem(idx).data();

    this.allowEditListSelectionField(tmpFieldId);//enable or disable fields based on selected field

    inventDimSetupGrid_ds.executeQuery();

    inventDimSetupGrid_ds.refresh();
}

void numberSeqPostInit()
{
    boolean anySameAsActive = numberSeqApplicationModule.anySameAsActive();

    numberSequenceReference_ds.object(fieldNum(NumberSequenceReference, AllowSameAs)).visible(anySameAsActive);
    labelSameAs.visible(anySameAsActive);
}

void numberSeqPreInit()
{
    runExecuteDirect   = false;

    numberSequenceModules = [NumberSeqModule::Invent, NumberSeqModule::BOM, NumberSeqModule::WMS
        , NumberSeqModule::Pds, NumberSeqModule::MRC
        ];
    numberSeqApplicationModule = new NumberSeqModuleInventory();
    scope = NumberSeqScopeFactory::createDataAreaScope();
    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));
}

