/// <summary>
/// Function is called only in cases where custom initialization based on caller form is required
/// Function first disables all the tab pages and then selectively enable and activate the tab page based on the caller
/// </summary>
void callerBasedFormInit(CostFormContext _formEnumValue)
{
    Tab.tab(0);
    InventoryAccounting.visible(false);
    General.visible(false);
    Journals.visible(false);
    BOM.visible(false);
    Locations.visible(false);
    Transports.visible(false);
    QualityManagementTabPage.visible(false);
    InventDimSetup.visible(false);
    MRC.visible(false);
    PdsCommodityPricing.visible(false);
    PrintManagementSetup.visible(false);
    NumberSeq.visible(false);

    switch (_formEnumValue)
    {
        case CostFormContext::Costing:
            InventoryAccounting.visible(true);
            InventoryAccounting.activatePage();
            element.design().caption("@SYS7764");
            break;
    }
}

