public void jumpRef()
{
    DimensionHierarchy  record = DimensionHierarchy::find(this.value());
    Args                args = new Args();

    args.caller(this);
    args.record(record);
    args.lookupRecord(record);

    MenuFunction::runClient(
        menuitemDisplayStr(DimensionFocusTable),
        MenuItemType::Display,
        true,
        args);
}

public Common lookupReference()
